import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import PSPE_Logo from '../images/PSPE_logo.png';


const style = {
    navbar: {
        height: '60px',
        width: '100%',
        backgroundColor: '#df9f00',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'flex-start',
        alignItems: 'flex-start',
        color: 'black',
        boxShadow: '0 10px 20px rgba(0,0,0,0.19), 0 6px 6px rgba(0,0,0,0.23)',
        marginBottom: '10px'
    },
    logo: {
        height: '50px',

        image: `url('../images/PSPE_logo.png')`,
        // backgroundPosition: 'center',
        // backgroundSize: 'cover',
        // backgroundRepeat: 'no-repeat',
        alignSelf: 'center',
        marginLeft: '20px'
    },
    navlink: {
        color: 'white',
        fontSize: '18px',
        alignSelf: 'center',
        margin: '10px',
        textDecoration: 'none',
        fontWeight: 'bold'
    },
    navlinkCollection: {
        height: '100%',
        flexGrow: '1',
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'flex-start',
        justifyContent: 'flex-start',
        marginLeft: '30px'
    }



};

export class Navbar extends Component {
	render() {
		return(
            <div style={style.navbar}>
                <Link style={style.logo} to="/"><section style={style.logoImage}></section></Link>
                <div style={style.navlinkCollection}>
                    <Link style={style.navlink} to="/">Home</Link>
                    <Link style={style.navlink} to="/about">About</Link>
                    <Link style={style.navlink} to="/events">Events</Link>
                    <Link style={style.navlink} to="/news">News</Link>
                    <Link style={style.navlink} to="/contact">Contact</Link>
                    <Link style={style.navlink} to="/sponsors">Sponsors</Link>
                </div>
            </div>
        );
	}
}

export default Navbar;
